/* Search */

.Search input {
  background: -moz-Field url(https://www.svgrepo.com/show/458878/search-alt.svg) .60rem / 35px no-repeat;
  border: 1px solid rgba(249, 249, 250, 0.2);
  padding: .70rem;
  color: transparent;
opacity: 70%;
  border-radius: 100px;
transition: 0.3s ease-in;
cursor: pointer;
}

.Search input::placeholder {
opacity: 50%;
color: transparent;
}

.Search input:focus::placeholder {
  color: transparent;
}

.Search input:focus {
background: -moz-Field url(https://www.svgrepo.com/show/458878/search-alt.svg) calc(100% - 0.75rem) .70rem / 33px no-repeat;
  border: solid 1px #0060df;
  box-shadow: 0 0 0 1px #0060df, 0 0 0 4px rgba(0, 96, 223, 0.3);
opacity: 95%;
width: 350px;
color:#666666;
transform: scale(1.2, 1.2);
cursor: text;
}


.Search input:not(:focus) {
    width: 55px !important;
transform: scale(1);
color: transparent;

}

